import { useState } from "react"

export const useFormulario = () => {

    const [formulario, setFormulario] = useState({
        email: 'test@mail.com',
        password: '12345'
    })

    const onChange = (value: string, campo: string) => {
        setFormulario({
            ...formulario,
            [campo]: value
        })

    }

    return {
        formulario,
        onChange
    }
}
